def load_initial_content(apps,schema_editor):
    Spirit = apps.get_model("pbf", "Spirit")
    Card = apps.get_model("pbf", "Card")

    for spirit in spirits:
        Spirit(name=spirit).save()

    for (spirit, name, cost, elements) in uniques:
        Card(name=name, type=CARD_UNIQUE, spirit=Spirit.objects.get(name=spirit), cost=cost, elements=elements).save()

    for (type, name, cost, elements) in cards:
        Card(name=name, type=type, cost=cost, elements=elements).save()

def delete_initial_content(apps,schema_editor):
    # This probably won't ever run, because there are later migrations that are irreversible
    # but it theoretically should work.
    Spirit = apps.get_model("pbf", "Spirit")
    Card = apps.get_model("pbf", "Card")

    for spirit in spirits:
        Card.objects.filter(spirit=Spirit.objects.get(name=spirit)).delete()
        Spirit.objects.get(name=spirit).delete()

    for (_, name, _, _) in cards:
        Card.objects.get(name=name).delete()

